import React from 'react'
import SchoolTimeline from "./SchoolTimeline"; 

function Projects() {
  return (
    <div className='bg-[#d4d4d8]'>
      <h1 className='text-left text-[#2b2b2b] text-4xl mx-10 mt-10'>Projects</h1>
      <h2 className='text-left text-[#38bdf8] mx-10'>Check out some of my creations.</h2>
      <Timeline defaultColor="bg-sky-400"></Timeline>
    </div>
  )
}

export default Projects
